import { FaFacebookF } from "react-icons/fa";
import { SlBasket } from "react-icons/sl";
import { Link } from 'react-router-dom';

const A = () => {
  return (
    <div>
        <Link to='/login'>login</Link>
        <br/>
        <Link to='/register'>register</Link>
        <br/>

        <Link to='/allproduct'>allproducts</Link>
        

        
    </div>
  )
}

export default A
